import React, { PureComponent } from 'react'
import './Profile.css'
import { useNavigation } from './useNavigation'; // adjust the path as needed

class ProfileClass extends PureComponent {
    handleButtonClick = () => {
        this.props.navigateTo('/hobbies-interests');
    }

    render() {
        return (
            <div className="button-container">
                <button onClick={this.handleButtonClick}>Create a Profile</button>
            </div>
        )
    }
}

function Profile() {
    const { navigateTo } = useNavigation();
    return <ProfileClass navigateTo={navigateTo} />;
}

export default Profile;
